import React from 'react';

const ProfilePage = () => {
    const user = JSON.parse(localStorage.getItem('user'));

    const renderUserInfo = () => {
        if (!user) {
            return <div>No user information found.</div>;
        }

        const {
            UserName,
            Email,
            EmailConfirmed,
            PhoneNumber,
            PhoneNumberConfirmed,
            TwoFactorEnabled,
            Followers
            // Add more fields as needed
        } = user;

        return (
            <div>
                <h2>User Information</h2>
                <p><strong>Username:</strong> {UserName}</p>
                <p><strong>Email:</strong> {Email}</p>
                <p><strong>Email Confirmed:</strong> {EmailConfirmed ? 'Yes' : 'No'}</p>
                <p><strong>Phone Number:</strong> {PhoneNumber ? PhoneNumber : 'N/A'}</p>
                <p><strong>Phone Number Confirmed:</strong> {PhoneNumberConfirmed ? 'Yes' : 'No'}</p>
                <p><strong>TwoFactorEnabled:</strong> {TwoFactorEnabled?'Yes':'No'}</p>
            </div>
        );
    };

    return (
        <div>
            <h1>Profile Page</h1>
            {renderUserInfo()}
        </div>
    );
};

export default ProfilePage;
